CREATE TABLE `Member` (`idx` INTEGER PRIMARY KEY AUTO_INCREMENT, `email` VARCHAR(200) NOT NULL, `password` VARCHAR(200) NOT NULL, `telephone` VARCHAR(200), `memberType` INTEGER(11) NOT NULL, `userName` VARCHAR(200), `initRegDate` DATETIME, `reqDropDate` DATETIME, `resetPasswordToken` VARCHAR(300), `resetPasswordExpires` INTEGER(10));

CREATE TABLE `BusinessMember` (`memberIdx` INTEGER PRIMARY KEY, `companyName` VARCHAR(200), `ownerName` VARCHAR(200), `bizRegNo` VARCHAR(200), `workPlace` VARCHAR(500), `contact` VARCHAR(200), `mainWorkField` VARCHAR(300), `mainWorkArea` VARCHAR(300), `aboutCompanyShort` VARCHAR(200), `aboutCompany` VARCHAR(1000), `companyLogo` VARCHAR(1000), `companyIntroImage` VARCHAR(1000));

CREATE TABLE `BuildCaseInfoBoard` (`idx` INTEGER PRIMARY KEY AUTO_INCREMENT, `memberIdx` INTEGER(10) REFERENCES `Member` (`idx`) ON DELETE CASCADE ON UPDATE CASCADE, `title` VARCHAR(200) NOT NULL, `buildType` INTEGER(10) NOT NULL, `buildPlace` VARCHAR(500), `buildTotalArea` INTEGER(10), `mainPreviewImage` VARCHAR(1000), `buildTotalPrice` INTEGER(10), `HTMLText` TEXT, `VRImages` VARCHAR(2000), `regionCategory` VARCHAR(1000), `initWriteDate` DATETIME, `fileRef` INTEGER(10) NOT NULL);

CREATE TABLE `UserSelectedBuildCaseBasket` (`id` INTEGER PRIMARY KEY AUTO_INCREMENT, `memberIdx` INTEGER(10) NOT NULL REFERENCES `Member` (`idx`) ON DELETE CASCADE ON UPDATE CASCADE, `buildCaseInfoIdx` INTEGER(10) NOT NULL REFERENCES `BuildCaseInfoBoard` (`idx`) ON DELETE CASCADE ON UPDATE CASCADE);

CREATE TABLE `UserConsultInfoBoard` (`idx` INTEGER PRIMARY KEY AUTO_INCREMENT, `memberIdx` INTEGER(10) NOT NULL REFERENCES `Member` (`idx`) ON DELETE CASCADE ON UPDATE CASCADE, `title` VARCHAR(200) NOT NULL, `acceptStatus` INTEGER(11) DEFAULT '0', `initWriteDate` DATETIME, `prefBizMemberIdx` INTEGER(10) REFERENCES `BusinessMember` (`memberIdx`) ON DELETE SET NULL ON UPDATE CASCADE, `buildType` INTEGER(10) NOT NULL, `prefBuildCaseInfoIdx` INTEGER(10) REFERENCES `BuildCaseInfoBoard` (`idx`) ON DELETE SET NULL ON UPDATE CASCADE, `userName` VARCHAR(200) NOT NULL, `telephone` VARCHAR(200) NOT NULL, `email` VARCHAR(200) NOT NULL, `expectBuildPrice` INTEGER(10), `buildPlace` VARCHAR(500) NOT NULL, `lived` INTEGER(11), `expectBuildTotalArea` INTEGER(10), `expectBuildStartDate` DATETIME, `expectConsultDate` DATETIME, `reqContents` TEXT);

CREATE TABLE `RoomInfoBoard` (`idx` INTEGER PRIMARY KEY AUTO_INCREMENT, `memberIdx` INTEGER(10) NOT NULL REFERENCES `Member` (`idx`), `title` VARCHAR(255) NOT NULL, `deposit` INTEGER(11), `roomType` INTEGER(11), `monthlyRentFee` INTEGER(11), `floor` INTEGER(11), `manageExpense` INTEGER(11), `manageService` VARCHAR(200), `areaSize` INTEGER(11), `actualSize` INTEGER(11), `parking` INTEGER(11), `elevator` INTEGER(11), `supplyOption` VARCHAR(500), `availableDate` DATETIME, `HTMLText` TEXT, `address` VARCHAR(500), `locationInfo` VARCHAR(1000), `VRImages` VARCHAR(2000), `mainPreviewImage` VARCHAR(1000) NOT NULL, `coordinate` VARCHAR(1000), `regionCategory` VARCHAR(1000), `initWriteDate` DATETIME, `fileRef` INTEGER(10) NOT NULL, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);

CREATE TABLE `HashTagTable` (`hashTag` VARCHAR(200) NOT NULL PRIMARY KEY);

COMMIT;